import React from "react";
import Foot from "../../assets/images/Foot.png";
import logo5 from "../../assets/images/foodie-logo-zip-file/png/logo5.png";

export default function Footer() {
  return (
    <div className="bg-black mt-20 relative h-200px">
      <div className="grid grid-cols-4 gap-4 items-center justify-center py-6">
        <div className="flex flex-col items-center">
          <img src={logo5} alt="Logo" className="w-32 h-auto" />
          <p className="text-white mt-2 text-sm font-light">All Rights Reserved</p>
        </div>
        <div className="text-center">
          <p className="text-white">Ads</p>
        </div>
        <div className="text-center">
          <p className="text-white">Ads</p>
        </div>
        <div className="text-center">
          <p className="text-white">Ads</p>
        </div>
      </div>
    </div>
  );
}
